import{_ as t,c as e,o as n,ah as a}from"./chunks/framework.DqD713j2.js";const _=JSON.parse('{"title":"MoonBit语言","description":"","frontmatter":{},"headers":[],"relativePath":"Document/WebAssembly/MoonBit语言.md","filePath":"Document/WebAssembly/MoonBit语言.md","lastUpdated":1750954157000}'),r={name:"Document/WebAssembly/MoonBit语言.md"};function i(s,o,l,m,p,b){return n(),e("div",null,o[0]||(o[0]=[a('<h1 id="moonbit语言" tabindex="-1">MoonBit语言 <a class="header-anchor" href="#moonbit语言" aria-label="Permalink to &quot;MoonBit语言&quot;">​</a></h1><p><a href="https://baike.baidu.com/item/MoonBit/64190586?fr=ge_ala" target="_blank" rel="noreferrer">MoonBit_百度百科 (baidu.com)</a></p><p>MoonBit 核心库（标准库）已托管至 GitHub：<a href="https://github.com/moonbitlang/core" target="_blank" rel="noreferrer">https://github.com/moonbitlang/core</a></p><p><a href="https://www.moonbitlang.cn/docs/syntax" target="_blank" rel="noreferrer">MoonBit | MoonBit (moonbitlang.cn)</a></p><p>官网：<a href="https://www.moonbitlang.cn/" target="_blank" rel="noreferrer">MoonBit (moonbitlang.cn)</a></p><h2 id="moonbit简介" tabindex="-1">MoonBit简介 <a class="header-anchor" href="#moonbit简介" aria-label="Permalink to &quot;MoonBit简介&quot;">​</a></h2><p>MoonBit是一个由深圳团队研发的编程语言，用于云计算和边缘计算的 WebAssembly 端到端的编程语言工具链。 可以访问官网获得 IDE 环境，无需安装任何软件。</p><p>MoonBit（月兔）是中国开发者团队创建的编程语言（类似 Rust，支持 GC），由粤港澳大湾区数字经济研究院（IDEA 研究院）基础软件中心负责人张宏波领导的团队开发，目标是打造下一代智能开发平台。</p><p>更确切地说，MoonBit 是一个用于云计算和边缘计算的 WebAssembly 端到端编程语言工具链，集开发、编译、测试、部署于一体 —— 涵盖了通用程序语言设计、编译器、构建系统、编辑器和语言服务器、IDE、部署工具等。</p><p>MoonBit 宣称是国内首个工业级编程语言及完整工具链，专为云 + AI 打造，其核心技术自主研发，通过专注 Wasm 形成后发优势，目前在核心指标（<strong>编译速度、运行速度、体积大小</strong>）已成功领先传统语言。</p><p>近日<strong>MoonBit 宣布正式开源核心库</strong>，并表示项目已接近 Beta 测试阶段，语言功能也趋于稳定。目前已建立了用于支持核心库开发的重要基础设施，确保提升语言功能的稳定性。</p>',11)]))}const h=t(r,[["render",i]]);export{_ as __pageData,h as default};
